CREATE TABLE `ma_oficina` (
  `id_oficina` int(11) NOT NULL AUTO_INCREMENT,
  `des_oficina` varchar(100) DEFAULT NULL,
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
